function Forms() {
    const handleSubmit = event => {
        event.preventDefault();
        alert('You have submitted the form.')
      }

    return(
        <div className="wrapper">
        <h1>Forms Teste</h1>
        <form onSubmit={handleSubmit}>
        <fieldset>
            <label>
            <p>CEP</p>
            <input name="CEP" />
            </label>
            <button type="submit">Submit</button>
        </fieldset>

        </form>
        </div>
    )
}

export default Forms
